import React from 'react';
import './footer.css'

class Footer extends React.Component {
   render() {
      return (
        <div id="footer" className="container-fluid">
          <div className="row">
            <div className="col-sm-4">
              <div className="card cardf">
                <div className="card-body">
                {FooterJson.map((item)=>{
                  return(
                    <div dangerouslySetInnerHTML={{__html:item.bodyText}}>
                    </div>
                  )})}
                </div>
              </div>
            </div>
            <div className="col-12 text-center">
                  <ul className="customercare list-inline">
                    <li className="list-inline-item"><a href="/contact">Contact Us</a></li>
                    <li  className="list-inline-item"><a href="/about">About Us</a></li>
                    <li  className="list-inline-item"><a href="/review">Review</a></li>
                  </ul>
              </div>
            <div className="col-12 rights text-center mt-4 mb-2">
              <span>Copyright &#169; 2021. All rights reserved.</span>
            </div>
          </div>
        </div>
      );
   }
}
export default Footer;
